INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'movies', 0, 881, 881, 'und', 0, 'Two imprisoned men bond over a number of years, finding solace and eventual redemption through acts of common decency.', NULL, 'plain_text'),
('node', 'movies', 0, 882, 882, 'und', 0, 'The aging patriarch of an organized crime dynasty transfers control of his clandestine empire to his reluctant son.', NULL, 'plain_text'),
('node', 'movies', 0, 883, 883, 'und', 0, 'The early life and career of Vito Corleone in 1920s New York is portrayed while his son, Michael, expands and tightens his grip on his crime syndicate stretching from Lake Tahoe, Nevada to pre-revolution 1958 Cuba.', NULL, 'plain_text'),
('node', 'movies', 0, 884, 884, 'und', 0, 'When the menace known as the Joker wreaks havoc and chaos on the people of Gotham, the caped crusader must come to terms with one of the greatest psychological tests of his ability to fight injustice.', NULL, 'plain_text'),
('node', 'movies', 0, 885, 885, 'und', 0, 'The lives of two mob hit men, a boxer, a gangster\'s wife, and a pair of diner bandits intertwine in four tales of violence and redemption.', NULL, 'plain_text'),
('node', 'movies', 0, 886, 886, 'und', 0, 'In Poland during World War II, Oskar Schindler gradually becomes concerned for his Jewish workforce after witnessing their persecution by the Nazis.', NULL, 'plain_text'),
('node', 'movies', 0, 887, 887, 'und', 0, 'A dissenting juror in a murder trial slowly manages to convince the others that the case is not as obviously clear as it seemed in court.', NULL, 'plain_text'),
('node', 'movies', 0, 888, 888, 'und', 0, 'A bounty hunting scam joins two men in an uneasy alliance against a third in a race to find a fortune in gold buried in a remote cemetery.', NULL, 'plain_text'),
('node', 'movies', 0, 889, 889, 'und', 0, 'Gandalf and Aragorn lead the World of Men against Sauron\'s army to draw his gaze from Frodo and Sam as they approach Mount Doom with the One Ring.', NULL, 'plain_text'),
('node', 'movies', 0, 890, 890, 'und', 0, 'An insomniac office worker looking for a way to change his life crosses paths with a devil-may-care soap maker and they form an underground fight club that evolves into something much, much more...', NULL, 'plain_text'),
('node', 'movies', 0, 891, 891, 'und', 0, 'A meek hobbit of the Shire and eight companions set out on a journey to Mount Doom to destroy the One Ring and the dark lord Sauron.', NULL, 'plain_text'),
('node', 'movies', 0, 892, 892, 'und', 0, 'After the rebels have been brutally overpowered by the Empire on their newly established base, Luke Skywalker takes advanced Jedi training with Master Yoda, while his friends are pursued by Darth Vader as part of his plan to capture Luke.', NULL, 'plain_text'),
('node', 'movies', 0, 893, 893, 'und', 0, 'Forrest Gump, while not intelligent, has accidentally been present at many historic moments, but his true love, Jenny Curran, eludes him.', NULL, 'plain_text'),
('node', 'movies', 0, 894, 894, 'und', 0, 'A thief who steals corporate secrets through use of dream-sharing technology is given the inverse task of planting an idea into the mind of a CEO.', NULL, 'plain_text'),
('node', 'movies', 0, 895, 895, 'und', 0, 'Upon admittance to a mental institution, a brash rebel rallies the patients to take on the oppressive head nurse.', NULL, 'plain_text'),
('node', 'movies', 0, 896, 896, 'und', 0, 'While Frodo and Sam edge closer to Mordor with the help of the shifty Gollum, the divided fellowship makes a stand against Sauron\'s new ally, Saruman, and his hordes of Isengard.', NULL, 'plain_text'),
('node', 'movies', 0, 897, 897, 'und', 0, 'Henry Hill and his friends work their way up through the mob hierarchy.', NULL, 'plain_text'),
('node', 'movies', 0, 898, 898, 'und', 0, 'A computer hacker learns from mysterious rebels about the true nature of his reality and his role in the war against its controllers.', NULL, 'plain_text'),
('node', 'movies', 0, 899, 899, 'und', 0, 'Luke Skywalker joins forces with a Jedi Knight, a cocky pilot, a wookiee and two droids to save the universe from the Empire\'s world-destroying battle-station, while also attempting to rescue Princess Leia from the evil Darth Vader.', NULL, 'plain_text'),
('node', 'movies', 0, 900, 900, 'und', 0, 'A poor village under attack by bandits recruits seven unemployed samurai to help them defend themselves.', NULL, 'plain_text'),
('node', 'movies', 0, 901, 901, 'und', 0, 'Two boys growing up in a violent neighborhood of Rio de Janeiro take different paths: one becomes a photographer, the other a drug dealer.', NULL, 'plain_text'),
('node', 'movies', 0, 902, 902, 'und', 0, 'A team of explorers travel through a wormhole in an attempt to ensure humanity\'s survival.', NULL, 'plain_text'),
('node', 'movies', 0, 903, 903, 'und', 0, 'Two detectives, a rookie and a veteran, hunt a serial killer who uses the seven deadly sins as his modus operandi.', NULL, 'plain_text'),
('node', 'movies', 0, 904, 904, 'und', 0, 'A sole survivor tells of the twisty events leading up to a horrific gun battle on a boat, which begin when five criminals meet at a seemingly random police lineup.', NULL, 'plain_text'),
('node', 'movies', 0, 905, 905, 'und', 0, 'A young F.B.I. cadet must confide in an incarcerated and manipulative killer to receive his help on catching another serial killer who skins his victims.', NULL, 'plain_text'),
('node', 'movies', 0, 906, 906, 'und', 0, 'An angel helps a compassionate but despairingly frustrated businessman by showing what life would have been like if he never existed.', NULL, 'plain_text'),
('node', 'movies', 0, 907, 907, 'und', 0, 'Epic story of a mysterious stranger with a harmonica who joins forces with a notorious desperado to protect a beautiful widow from a ruthless assassin working for the railroad.', NULL, 'plain_text'),
('node', 'movies', 0, 908, 908, 'und', 0, 'Mathilda, a 12-year-old girl, is reluctantly taken in by Léon, a professional assassin, after her family is murdered. Léon and Mathilda form an unusual relationship, as she becomes his protégée and learns the assassin\'s trade.', NULL, 'plain_text'),
('node', 'movies', 0, 909, 909, 'und', 0, 'A Jewish man has a wonderful romance with the help of his humour, but must use that same quality to protect his son in a Nazi concentration camp.', NULL, 'plain_text'),
('node', 'movies', 0, 910, 910, 'und', 0, 'Set in unoccupied Africa during the early days of World War II: An American expatriate meets a former lover, with unforeseen complications.', NULL, 'plain_text'),
('node', 'movies', 0, 911, 911, 'und', 0, 'A former neo-nazi skinhead tries to prevent his younger brother from going down the same wrong path that he did.', NULL, 'plain_text'),
('node', 'movies', 0, 912, 912, 'und', 0, 'Archaeologist and adventurer Indiana Jones is hired by the US government to find the Ark of the Covenant before the Nazis.', NULL, 'plain_text'),
('node', 'movies', 0, 913, 913, 'und', 0, 'Following the Normandy Landings, a group of U.S. soldiers go behind enemy lines to retrieve a paratrooper whose brothers have been killed in action.', NULL, 'plain_text'),
('node', 'movies', 0, 914, 914, 'und', 0, 'In the middle of her family\'s move to the suburbs, a sullen 10-year-old girl wanders into a world ruled by gods, witches, and monsters; where humans are changed into beasts.', NULL, 'plain_text'),
('node', 'movies', 0, 915, 915, 'und', 0, 'With the aid of a wealthy erratic tippler, a dewy-eyed tramp who has fallen in love with a sightless flower girl accumulates money to be able to help her medically.', NULL, 'plain_text'),
('node', 'movies', 0, 916, 916, 'und', 0, 'A Phoenix secretary steals $40,000 from her employer\'s client, goes on the run and checks into a remote motel run by a young man under the domination of his mother.', NULL, 'plain_text'),
('node', 'movies', 0, 917, 917, 'und', 0, 'A wheelchair bound photographer spies on his neighbours from his apartment window and becomes convinced one of them has committed murder.', NULL, 'plain_text'),
('node', 'movies', 0, 918, 918, 'und', 0, 'A promising young drummer enrolls at a cut-throat music conservatory where his dreams of greatness are mentored by an instructor who will stop at nothing to realize a student\'s potential.', NULL, 'plain_text'),
('node', 'movies', 0, 919, 919, 'und', 0, 'After he becomes a quadriplegic from a paragliding accident, an aristocrat hires a young man from the projects to be his caregiver.', NULL, 'plain_text'),
('node', 'movies', 0, 920, 920, 'und', 0, 'The Tramp struggles to live in modern industrial society with the help of a young homeless woman.', NULL, 'plain_text'),
('node', 'movies', 0, 921, 921, 'und', 0, 'A cyborg, identical to the one who failed to kill Sarah Connor, must now protect her young son, John Connor, from a more advanced cyborg, made out of liquid metal.', NULL, 'plain_text'),
('node', 'movies', 0, 922, 922, 'und', 0, 'The lives of guards on Death Row are affected by one of their charges: a black man accused of child murder and rape, yet who has a mysterious gift.', NULL, 'plain_text'),
('node', 'movies', 0, 923, 923, 'und', 0, 'A man creates a strange system to help him remember things; so he can hunt for the murderer of his wife without his short-term memory loss being an obstacle.', NULL, 'plain_text'),
('node', 'movies', 0, 924, 924, 'und', 0, 'A Polish Jewish musician struggles to survive the destruction of the Warsaw ghetto of World War II.', NULL, 'plain_text'),
('node', 'movies', 0, 925, 925, 'und', 0, 'An undercover state cop who has infiltrated an Irish gang and a mole in the police force working for the same mob race to track down and identify each other before being exposed to the enemy, after both sides realize their outfit has a rat.', NULL, 'plain_text'),
('node', 'movies', 0, 926, 926, 'und', 0, 'When a Roman general is betrayed and his family murdered by an emperor\'s corrupt son, he comes to Rome as a gladiator to seek revenge.', NULL, 'plain_text'),
('node', 'movies', 0, 927, 927, 'und', 0, 'During the Vietnam War, Captain Willard is sent on a dangerous mission into Cambodia to assassinate a renegade colonel who has set himself up as a god among a local tribe.', NULL, 'plain_text'),
('node', 'movies', 0, 928, 928, 'und', 0, 'A hack screenwriter writes a screenplay for a former silent-film star who has faded into Hollywood obscurity.', NULL, 'plain_text'),
('node', 'movies', 0, 929, 929, 'und', 0, 'An insane general triggers a path to nuclear holocaust that a war room full of politicians and generals frantically try to stop.', NULL, 'plain_text'),
('node', 'movies', 0, 930, 930, 'und', 0, 'A young man is accidentally sent 30 years into the past in a time-traveling DeLorean invented by his friend, Dr. Emmett Brown, and must make sure his high-school-age parents unite in order to save his own existence.', NULL, 'plain_text'),
('node', 'movies', 0, 931, 931, 'und', 0, 'The commercial vessel Nostromo receives a distress call from an unexplored planet. After searching for survivors, the crew heads home only to realize that a deadly bioform has joined them.', NULL, 'plain_text'),
('node', 'movies', 0, 932, 932, 'und', 0, 'Two stage magicians engage in competitive one-upmanship in an attempt to create the ultimate stage illusion.', NULL, 'plain_text'),
('node', 'movies', 0, 933, 933, 'und', 0, 'Dictator Adenoid Hynkel tries to expand his empire while a poor Jewish barber tries to avoid persecution from Hynkel\'s regime.', NULL, 'plain_text'),
('node', 'movies', 0, 934, 934, 'und', 0, 'Lion cub and future king Simba tests his limits, supported by his family, but sometimes gets in over his head.', NULL, 'plain_text'),
('node', 'movies', 0, 935, 935, 'und', 0, 'In 1984 East Berlin, an agent of the secret police, conducting surveillance on a writer and his lover, finds himself becoming increasingly absorbed by their lives.', NULL, 'plain_text'),
('node', 'movies', 0, 936, 936, 'und', 0, 'A filmmaker recalls his childhood, when he fell in love with the movies at his village\'s theater and formed a deep friendship with the theater\'s projectionist.', NULL, 'plain_text'),
('node', 'movies', 0, 937, 937, 'und', 0, 'With the help of a German bounty hunter, a freed slave sets out to rescue his wife from a brutal Mississippi plantation owner.', NULL, 'plain_text'),
('node', 'movies', 0, 938, 938, 'und', 0, 'A family heads to an isolated hotel for the winter where an evil and spiritual presence influences the father into violence, while his psychic son sees horrific forebodings from the past and of the future.', NULL, 'plain_text'),
('node', 'movies', 0, 939, 939, 'und', 0, 'Eight years after the Joker\'s reign of anarchy, the Dark Knight is forced to return from his imposed exile to save Gotham City from the brutal guerrilla terrorist Bane with the help of the enigmatic Catwoman.', NULL, 'plain_text'),
('node', 'movies', 0, 940, 940, 'und', 0, 'When soldiers in World War I refuse to continue with an impossible attack, their superior officers decide to make an example of them.', NULL, 'plain_text'),
('node', 'movies', 0, 941, 941, 'und', 0, 'A sexually frustrated suburban father has a mid-life crisis after becoming infatuated with his daughter\'s best friend.', NULL, 'plain_text'),
('node', 'movies', 0, 942, 942, 'und', 0, 'In the distant future, a small waste collecting robot inadvertently embarks on a space journey that will ultimately decide the fate of mankind.', NULL, 'plain_text'),
('node', 'movies', 0, 943, 943, 'und', 0, 'A hapless New York advertising executive is mistaken for a government agent by a group of foreign spies, and is pursued across the country while he looks for a way to survive.', NULL, 'plain_text'),
('node', 'movies', 0, 944, 944, 'und', 0, 'The planet from Alien (1979) has been colonized, but contact is lost. This time, the rescue team has impressive firepower, but will it be enough?', NULL, 'plain_text'),
('node', 'movies', 0, 945, 945, 'und', 0, 'Following the death of a publishing tycoon, news reporters scramble to discover the meaning of his final utterance.', NULL, 'plain_text'),
('node', 'movies', 0, 946, 946, 'und', 0, 'A retired San Francisco detective suffering from acrophobia investigates the strange activities of an old friend\'s wife, all the while becoming dangerously obsessed with her.', NULL, 'plain_text'),
('node', 'movies', 0, 947, 947, 'und', 0, 'A tragic film covering a young boy and his little sister\'s struggle to survive in Japan during World War II.', NULL, 'plain_text'),
('node', 'movies', 0, 948, 948, 'und', 0, 'Amelie is an innocent and naive girl in Paris with her own sense of justice. She decides to help those around her and, along the way, discovers love.', NULL, 'plain_text'),
('node', 'movies', 0, 949, 949, 'und', 0, 'When the police in a German city are unable to catch a child-murderer, other criminals join in the manhunt.', NULL, 'plain_text'),
('node', 'movies', 0, 950, 950, 'und', 0, 'The claustrophobic world of a WWII German U-boat; boredom, filth, and sheer terror.', NULL, 'plain_text'),
('node', 'movies', 0, 951, 951, 'und', 0, 'After being kidnapped and imprisoned for 15 years, Oh Dae-Su is released, only to find that he must find his captor in 5 days.', NULL, 'plain_text'),
('node', 'movies', 0, 952, 952, 'und', 0, 'On a journey to find the cure for a Tatarigami\'s curse, Ashitaka finds himself in the middle of a war between the forest gods and Tatara, a mining colony. In this quest he also meets San, the Mononoke Hime.', NULL, 'plain_text'),
('node', 'movies', 0, 953, 953, 'und', 0, 'After rescuing Han Solo from the palace of Jabba the Hutt, the rebels attempt to destroy the second Death Star, while Luke struggles to make Vader shake off of the dark side of the Force.', NULL, 'plain_text'),
