('node', 'movies', 0, 955, 955, 'und', 0, 'A former Prohibition-era Jewish gangster returns to the Lower East Side of Manhattan over thirty years later, where he once again must confront the ghosts and regrets of his old life.', NULL, 'plain_text'),
('node', 'movies', 0, 956, 956, 'und', 0, 'After a simple jewelery heist goes terribly wrong, the surviving criminals begin to suspect that one of them is a police informant.', NULL, 'plain_text'),
