('node', 'movies', 0, 1091, 1091, 'und', 0, 'When a gigantic great white shark begins to menace the small island community of Amity, a police chief, a marine scientist and grizzled fisherman set out to stop it.', NULL, 'plain_text'),
('node', 'movies', 0, 1092, 1092, 'und', 0, 'A young man and woman meet on a train in Europe, and wind up spending one evening together in Vienna. Unfortunately, both know that this will probably be their only night together.', NULL, 'plain_text'),
('node', 'movies', 0, 1093, 1093, 'und', 0, 'The people of a small village in Victorian India stake their future on a game of cricket against their ruthless British rulers...', NULL, 'plain_text'),
('node', 'movies', 0, 1094, 1094, 'und', 0, 'A marshall, personally compelled to face a returning deadly enemy, finds that his own town refuses to help him.', NULL, 'plain_text'),
('node', 'movies', 0, 1095, 1095, 'und', 0, 'A human-looking indestructible cyborg is sent from 2029 to 1984 to assassinate a waitress, whose unborn son will lead humanity in a war against the machines, while a soldier from that war is sent to protect her at all costs.', NULL, 'plain_text'),
('node', 'movies', 0, 1096, 1096, 'und', 0, 'A clash between Sultan (a Qureishi dacoit chief) and Shahid Khan (a Pathan who impersonates him) leads to the expulsion of Khan from Wasseypur, and ignites a deadly blood feud spanning three generations.', NULL, 'plain_text'),
('node', 'movies', 0, 1097, 1097, 'und', 0, 'A weatherman finds himself living the same day over and over again.', NULL, 'plain_text'),
('node', 'movies', 0, 1098, 1098, 'und', 0, 'Two young Swedish children experience the many comedies and tragedies of their family, the Ekdahls.', NULL, 'plain_text'),
('node', 'movies', 0, 1099, 1099, 'und', 0, 'A woman is asked to spy on a group of Nazi friends in South America. How far will she have to go to ingratiate herself with them?', NULL, 'plain_text'),
('node', 'movies', 0, 1100, 1100, 'und', 0, 'The story of King George VI of the United Kingdom of Great Britain and Northern Ireland, his impromptu ascension to the throne and the speech therapist who helped the unsure monarch become worthy of it.', NULL, 'plain_text'),
('node', 'movies', 0, 1101, 1101, 'und', 0, 'Harry, Ron and Hermione search for Voldemort\'s remaining Horcruxes in their effort to destroy the Dark Lord as the final battle rages on at Hogwarts.', NULL, 'plain_text'),
('node', 'movies', 0, 1102, 1102, 'und', 0, 'A semi-biographical account of Yip Man, the first martial arts master to teach the Chinese martial art of Wing Chun.', NULL, 'plain_text'),
('node', 'movies', 0, 1103, 1103, 'und', 0, 'Rocky Balboa, a small-time boxer gets a supremely rare chance to fight the heavy-weight champion, Apollo Creed, in a bout in which he strives to go the distance for his self-respect.', NULL, 'plain_text'),
('node', 'movies', 0, 1104, 1104, 'und', 0, 'Monsters generate their city\'s power by scaring children, but they are terribly afraid themselves of being contaminated by children, so when one enters Monstropolis, top scarer Sulley finds his world disrupted.', NULL, 'plain_text'),
('node', 'movies', 0, 1105, 1105, 'und', 0, 'In the 1950s, fear and violence escalate as the people of Algiers fight for independence from the French government.', NULL, 'plain_text'),
('node', 'movies', 0, 1106, 1106, 'und', 0, 'A religious fanatic marries a gullible widow whose young children are reluctant to tell him where their real daddy hid $10,000 he\'d stolen in a robbery.', NULL, 'plain_text'),
('node', 'movies', 0, 1107, 1107, 'und', 0, 'After local youth Abdel is beaten unconscious by police, a riot ensues on his estate during which a policeman loses his gun. The gun is found by Vinz who threatens he will kill a cop if Abdel dies.', NULL, 'plain_text'),
('node', 'movies', 0, 1108, 1108, 'und', 0, 'The X-Men send Wolverine to the past in a desperate effort to change history and prevent an event that results in doom for both humans and mutants.', NULL, 'plain_text'),
('node', 'movies', 0, 1109, 1109, 'und', 0, 'In 1986, in the province of Gyunggi, in South Korea, a second young and beautiful woman is found dead, raped and tied and gagged with her underwear. Detective Park Doo-Man and Detective Cho...', NULL, 'plain_text'),
('node', 'movies', 0, 1110, 1110, 'und', 0, 'A man robs a bank to pay for his lover\'s operation; it turns into a hostage situation and a media circus.', NULL, 'plain_text'),
('node', 'movies', 0, 1111, 1111, 'und', 0, 'An Irish rogue wins the heart of a rich widow and assumes her dead husband\'s aristocratic position in 18th-century England.', NULL, 'plain_text'),
('node', 'movies', 0, 1112, 1112, 'und', 0, 'A wandering gunfighter plays two rival families against each other in a town torn apart by greed, pride, and revenge.', NULL, 'plain_text'),
('node', 'movies', 0, 1113, 1113, 'und', 0, 'Blacksmith Will Turner teams up with eccentric pirate \"Captain\" Jack Sparrow to save his love, the governor\'s daughter, from Jack\'s former pirate allies, who are now undead.', NULL, 'plain_text'),
('node', 'movies', 0, 1114, 1114, 'und', 0, 'A bitter aging couple with the help of alcohol, use a young couple to fuel anguish and emotional pain towards each other.', NULL, 'plain_text'),
('node', 'movies', 0, 1115, 1115, 'und', 0, 'A spy organization recruits an unrefined, but promising street kid into the agency\'s ultra-competitive training program just as a global threat emerges from a twisted tech genius.', NULL, 'plain_text');
INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'movies', 0, 1116, 1116, 'und', 0, 'An insurance salesman/adjuster discovers his entire life is actually a T.V. show.', NULL, 'plain_text'),
('node', 'movies', 0, 1117, 1117, 'und', 0, 'A young boy and a girl with a magic crystal must race against pirates and foreign agents in a search for a legendary floating castle.', NULL, 'plain_text'),
('node', 'movies', 0, 1118, 1118, 'und', 0, 'A care-free girl is sold to a traveling entertainer, consequently enduring physical and emotional pain along the way.', NULL, 'plain_text'),
('node', 'movies', 0, 1119, 1119, 'und', 0, 'During a preview tour, a theme park suffers a major power breakdown that allows its cloned dinosaur exhibits to run amok.', NULL, 'plain_text'),
('node', 'movies', 0, 1120, 1120, 'und', 0, 'An aspiring author during the civil rights movement of the 1960s decides to write a book detailing the African-American maids\' point of view on the white families for which they work, and the hardships they go through on a daily basis.', NULL, 'plain_text'),
('node', 'movies', 0, 1121, 1121, 'und', 0, 'Private detective Philip Marlowe is hired by a rich family. Before the complex case is over, he\'s seen murder, blackmail, and what might be love.', NULL, 'plain_text'),
('node', 'movies', 0, 1122, 1122, 'und', 0, 'A bored and sheltered princess escapes her guardians and falls in love with an American newsman in Rome.', NULL, 'plain_text'),
('node', 'movies', 0, 1123, 1123, 'und', 0, 'Recent college graduate Benjamin Braddock is trapped into an affair with Mrs. Robinson, who happens to be the wife of his father\'s business partner and then finds himself falling in love with her daughter, Elaine.', NULL, 'plain_text'),
('node', 'movies', 0, 1124, 1124, 'und', 0, 'A man befriends a fellow criminal as the two of them begin serving their sentence on a dreadful prison island, which inspires the man to plot his escape.', NULL, 'plain_text'),
('node', 'movies', 0, 1125, 1125, 'und', 0, 'When Keller Dover\'s daughter and her friend go missing, he takes matters into his own hands as the police pursue multiple leads and the pressure mounts. But just how far will this desperate father go to protect his family?', NULL, 'plain_text'),
('node', 'movies', 0, 1126, 1126, 'und', 0, 'Belle, whose father is imprisoned by the Beast, offers herself instead and discovers her captor to be an enchanted prince.', NULL, 'plain_text'),
('node', 'movies', 0, 1127, 1127, 'und', 0, 'An up-and-coming pool player plays a long-time champion in a single high-stakes match.', NULL, 'plain_text'),
('node', 'movies', 0, 1128, 1128, 'und', 0, 'A stranger in the city asks questions no one has asked before. Known only by his initials, P.K.\'s innocent questions and childlike curiosity will take him on a journey of love, laughter and letting-go.', NULL, 'plain_text'),
('node', 'movies', 0, 1129, 1129, 'und', 0, 'A secret military project endangers Neo-Tokyo when it turns a biker gang member into a rampaging psionic psychopath that only two kids and a group of psionics can stop.', NULL, 'plain_text'),
('node', 'movies', 0, 1130, 1130, 'und', 0, 'Nine years after Jesse and Celine first met, they encounter each other again on the French leg of Jesse\'s book tour.', NULL, 'plain_text');
